import React from 'react'
import './Contact.scss'
import '../../index.scss'
import { ReactComponent as Linkedin } from '../../assets/linkedin.svg'
import { ReactComponent as Github } from '../../assets/github.svg';
import { ReactComponent as Instagram } from '../../assets/instagram.svg';

const contactType = {
    LINKEDIN: 'Linkedin',
    GITHUB: 'Github',
    INSTAGARM: 'Instagram'
}

function handleClick(buttonType) {
    switch (buttonType) {
        case contactType.LINKEDIN:

            break;
        case contactType.GITHUB:
            break;
        case contactType.INSTAGARM:
            break;
        default:
            break;
    }
}

function Contact() {
    return (
        <div className="fullscreen-container about-background">
            <div className="content-container">
                <h1>Let's talk about dogs, basketball, code and dogs</h1>
                <div>
                    <button className="contact-button">
                        <Linkedin onClick={() => handleClick(contactType.LINKEDIN)}/>
                    </button>
                    <button className="contact-button">
                        <Github className="circle-logo" onClick={() => handleClick(contactType.GITHUB)}/>
                    </button>
                        <a>
                        <Instagram onClick={() => handleClick(contactType.INSTAGARM)}/>
                        </a>

                </div>  
            </div>
        </div>
    )
}

export default Contact;
